CREATE TABLE indiewise_db.Action
(
    id char(36) PRIMARY KEY NOT NULL,
    actor char(36),
    project char(36),
    comment char(36),
    critique char(36),
    nomination char(36),
    rating char(36),
    reaction char(36),
    createdAt datetime,
    verb varchar(255),
    userIds text,
    seen bit(1) DEFAULT b'0',
    win char(36),
    CONSTRAINT users_actor_bkname_actions FOREIGN KEY (actor) REFERENCES users (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT project_project_bkname_actions FOREIGN KEY (project) REFERENCES Project (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT comment_comment_bkname_actions FOREIGN KEY (comment) REFERENCES Comment (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT critique_critique_bkname_actions FOREIGN KEY (critique) REFERENCES Critique (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT nomination_nomination_bkname_actions FOREIGN KEY (nomination) REFERENCES Nomination (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT rating_rating_bkname_actions FOREIGN KEY (rating) REFERENCES Rating (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT reaction_reaction_bkname_actions FOREIGN KEY (reaction) REFERENCES Reaction (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT awardwin_win_bkname_actions FOREIGN KEY (win) REFERENCES AwardWin (id) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE UNIQUE INDEX action_id_unique ON indiewise_db.Action (id);
CREATE INDEX awardwin_win_bkname_actions ON indiewise_db.Action (win);
CREATE INDEX comment_comment_bkname_actions ON indiewise_db.Action (comment);
CREATE INDEX critique_critique_bkname_actions ON indiewise_db.Action (critique);
CREATE INDEX nomination_nomination_bkname_actions ON indiewise_db.Action (nomination);
CREATE INDEX project_project_bkname_actions ON indiewise_db.Action (project);
CREATE INDEX rating_rating_bkname_actions ON indiewise_db.Action (rating);
CREATE INDEX reaction_reaction_bkname_actions ON indiewise_db.Action (reaction);
CREATE INDEX users_actor_bkname_actions ON indiewise_db.Action (actor);
